import { fork } from 'redux-saga/effects'
import { watchInitLoad } from './initLoadSaga'
import { watchClickEmployee } from './employeeDetail'
import { watchEmployeePage } from './employees'

export default function* rootSaga() {
    yield fork(watchInitLoad);
    yield fork(watchClickEmployee);
    yield fork(watchClickChangeEmployee);
    yield fork(watchEmployeePage);

}
